        <Grid container>
          <Grid item xs={6}>
            <Box border={2}>dddmdmmd</Box>
          </Grid>
          <Grid item xs={6}>
            <Box border={2}>dddmdmmd</Box>
          </Grid>
        </Grid>
      </div>
